import "./Search.scss";

const Search = () => {
  return (
    <div className="search">
      <label htmlFor="search" className="search__label">
        Search:
      </label>
      <input
        id="search"
        className="search__input"
        type="text"
        placeholder="Type to search..."
        aria-label="Search"
      />
    </div>
  );
};

export default Search;
